import React, {useState} from 'react'

function App() {

  const[count, setCount] = useState(0);

  const handleIncrease = ()=>{
    setCount(count + 1);
  }


  return (
    <div>
      count : <h1>{count}</h1>
      <hr/>

      <div>
      <button type="button" onClick={handleIncrease}>Increase</button>
      <button type="button"></button>
      </div>
    </div>
  )
 }

export default App
